export function From(props) {
    const handleChangeFromDate = (event) => {
      props.setFromDate(event.target.value);
    };
    return (
      <label>
        Desde
        <input
          value={props.fromDate}
          onChange={handleChangeFromDate}
          type="date"
        />
      </label>
    );
  }
  export function To(props) {
    const handleChangeToDate = (event) => {
      props.setToDate(event.target.value);
    };
    return (
      <label>
        Desde
        <input
          value={props.propiedadToDate}
          onChange={handleChangeToDate}
          type="date"
        />
      </label>
    );
  }
